        "render": "render"
    },
    "_viewModelId": "AwI18n",
    "_uniqueViewModelId": "AwI18n",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awI18nRenderFunction, undefined, ctxImportObj );

export default Component;
